import React from 'react';
import logo from './logo.svg';
import './App.css';
//import './style.css';
import {Basic,Alerts,Patients} from './components/doctor';
import {Layout} from './sidebar'

const hr={
  marginTop:"25px"
}
const heading={
  textAlign:"center"
}
function App() {
  return (
    <div>
      <h1 style={heading}>Doctor Portal</h1>
      <hr style={hr}></hr>
      <div className="App">
        <div className="topbox">      
          <Basic />
        </div>
        <div className="alerts">
          <Alerts />
          <br></br>
        </div>
        <div className="patient_list">
          <Patients />
        </div>
      </div>
      <Layout />
    </div>
  )
}

export default App;
